import React from 'react';
import {baseURL} from '../services/OpenAI';
import axios from 'axios';

class PetNamesResultComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            response: {
                names: [],
                specie: "",
            },
        }
    }
    componentDidMount(){
        if (this.props.specie === ""){
            return;
        }
        axios
         .post(baseURL + "nlp-pet-name-fake/specie/" + this.props.specie)
         .then((response) => {
            this.setState({response: response.data});
         })
         .catch((error) => {
            console.log(error);
         });
        return;
    }

    render(){
        const renderResponse = () => {
            console.log(this.state.response);
            if(this.state.response.names.length > 0){
                const namesList = this.state.response.names.map((name) => (
                    <li>{name}</li>
                ));
                const res = (
                <>
                    <p>Specie: {this.state.response.specie}</p>
                </>
                );
                return res;
            }
            else
            {
                return <p>There are no names for this specie</p>
            }
        }
        return(
            <div className="result-pet-names">
                {renderResponse()}
            </div>
        )
    }
}

export default PetNamesResultComponent;
